(1, 'Classic 500', 'Royal Enfield Classic 500 is the elder sibling of Classic 350 which mimics styling of the former. For power generation the bike relies on a 499cc, single cylinder, 4-stroke Twinspark engine developing peak power output of 27.2bhp 5250rpm along with top torque of 41.3Nm at 4000rpm. The engine comes mated to a five-speed constant mesh gearbox. Suspension set up comprises of telescopic front forks and twin gas charged rear shock absorbers.\r\n\r\nSlotted above the Classic 350 in REâ€™s line-up, the 500 Classic is styled on the lines of retro theme. As the name suggests, the bike features a 500cc engine producing decent power and torque output. The fuel injected engine comes mated to a constant mesh gearbox and gets telescopic front forks along with twin gas charged shock absorbers at rear.', 'Royal Enfield', 'Single Cylinder, 4 stroke, Spark ignition, Aircooled, Fuel injection', '499cc', '84mm x 90mm', '8.5:1', '27.2 bhp @ 5250 rpm', '41.3 Nm @ 4000 rpm', 'Digital electronic ignition', 'Wet, multi-plate', '5 Speed Constant Mesh', 'Wet sump', '15 W 50 API, SL Grade & above, JASO MA 2', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2017-07-06 06:37:24', '2017-07-06 06:37:24');

