(1, 'renatio::invoice', 'Invoice', '<html>\r\n    <head>\r\n        <style type="text/css" media="screen">\r\n            {{ css|raw }}\r\n        </style>\r\n    </head>\r\n    <body style="background: url({{ background_img }}) top left no-repeat;">\r\n        <div class="header">\r\n            <p class="left"><strong>www.hotelladakhimperial.com</strong></p>\r\n            <p class="right">\r\n                <strong>Hotel Ladakh Imperial</strong><br>\r\n                Changspa Road<br>\r\n                Leh Ladakh<br>\r\n                194101 India\r\n            </p>\r\n        </div>\r\n        <div class="footer">\r\n            <p class="left">\r\n                Tel. +91-10982-250000<br>\r\n                Fax: +91-10982-250000<br>\r\n                E-mail: info@hotelladakhimperial.com<br>\r\n                USt-IdNr.: 194101 India\r\n            </p>\r\n            <p class="right">\r\n                Bank: Hotel Ladakh Imperial<br>\r\n                Contact: Admin Person<br>\r\n                Inv: DE41413113131<br>\r\n                BIC: 341314\r\n            </p>\r\n        </div>\r\n        {{ content_html|raw }}\r\n    </body>\r\n</html>', '@font-face {\r\n    font-family: ''Open Sans'';\r\n    src: url(''plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Regular.ttf'');\r\n}\r\n\r\n@font-face {\r\n    font-family: ''Open Sans'';\r\n    font-weight: bold;\r\n    src: url(''plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Bold.ttf'');\r\n}\r\n\r\n@font-face {\r\n    font-family: ''Open Sans'';\r\n    font-style: italic;\r\n    src: url(''plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Italic.ttf'');\r\n}\r\n\r\n@font-face {\r\n    font-family: ''Open Sans'';\r\n    font-style: italic;\r\n    font-weight: bold;\r\n    src: url(''plugins/renatio/dynamicpdf/assets/fonts/OpenSans-BoldItalic.ttf'');\r\n}\r\n\r\n@page {\r\n    margin: 0;\r\n    padding: 0;\r\n}\r\n\r\nbody {\r\n    font-family: ''Open Sans'', sans-serif;\r\n    font-size: 14px;\r\n}\r\n\r\n.header {\r\n    position: fixed;\r\n    top: 3%;\r\n    left: 30%;\r\n}\r\n\r\n.header .left {\r\n    color: #373430;\r\n    font-size: .9em;\r\n    text-transform: uppercase;\r\n    width: 60%;\r\n    display: inline-block;\r\n}\r\n\r\n.header .right {\r\n    font-size: .7em;\r\n    color: #545554;\r\n    line-height: 1em;\r\n    text-align: right;\r\n    display: inline-block;\r\n    width: 30%;\r\n    padding-top: 1%;\r\n}\r\n\r\n.footer {\r\n    position: fixed;\r\n    bottom: 0;\r\n    left: 5%;\r\n    height: 12%;\r\n    font-size: .7em;\r\n    color: #545554;\r\n    line-height: 1em;\r\n}\r\n\r\n.footer .left {\r\n    display: inline-block;\r\n    width: 25%;\r\n}\r\n\r\n.footer .right {\r\n    display: inline-block;\r\n    width: 30%;\r\n    padding-top: 7%;\r\n}\r\n\r\n.content {\r\n    margin: 12% 0 0 10%;\r\n}\r\n\r\n.small-txt {\r\n    font-size: .7em;\r\n}\r\n\r\n.company-info {\r\n    display: inline-block;\r\n    width: 55%;\r\n    line-height: 1.1em;\r\n    font-size: 1.1em;\r\n}\r\n\r\n.customer-info {\r\n    display: inline-block;\r\n    width: 45%;\r\n    font-size: .9em;\r\n    height: 10%;\r\n}\r\n\r\n.summary {\r\n    margin: 10% 0 5% 0;\r\n    border-collapse: collapse;\r\n    width: 90%;\r\n}\r\n\r\n.summary th {\r\n    background-color: #BEBEBE;\r\n    border: 1px solid #000;\r\n    padding: 5px;\r\n}\r\n\r\n.summary td {\r\n    padding: 5px 10px;\r\n    border-right: 1px solid #000;\r\n}\r\n\r\n.summary .col-1 {\r\n    width: 15%;\r\n    text-align: center;\r\n    border-left: 1px solid #000;\r\n}\r\n\r\n.summary .col-2 {\r\n    width: 50%;\r\n}\r\n\r\n.summary .col-3 {\r\n    width: 15%;\r\n    text-align: right;\r\n}\r\n\r\n.summary .col-4 {\r\n    width: 20%;\r\n    text-align: right;\r\n}\r\n\r\n.summary .bt {\r\n    border-top: 1px solid #000;\r\n}\r\n\r\n.summary .sum-price .col-4 {\r\n    border-top: 1px solid #000;\r\n    border-bottom: 1px solid #000;\r\n}', '2017-05-24 03:30:34', '2017-06-03 23:50:05');

