price">\r\n            <td colspan="3" class="col-3"><strong>Amount</strong></td>\r\n            <td class="col-4">9.515,37 &euro;</td>\r\n        </tr>\r\n    </table>\r\n    <p><strong>Amount to be paid to due date as mentioned in here.</strong></p>\r\n\r\n    <p>Please contact customer support for further information regarding this invoice.</p>\r\n</div>', '2017-05-24 03:30:34', '2017-06-04 00:42:11');

