(1, 'backend::mail.invite', 'Welcome to Hotel Ladakh Imperial', 'Invitation for newly created administrators.', '<p>Hi {{ name }},</p>\r\n\r\n<p>A user account has been created for you.</p>\r\n\r\n<p>\r\n    Login: {{ login }}<br />\r\n    Password: {{ password }}\r\n</p>\r\n\r\n<p>After signing in you should change your password by clicking your name on the top right corner of the administration area.</p>\r\n\r\n<p>\r\n    You can use the following link to sign in:<br />\r\n    <a href="{{ link }}">{{ link }}</a>\r\n</p>', 'Hi {{ name }},\r\n\r\nA user account has been created for you.\r\n\r\nLogin: {{ login }}\r\n\r\nPassword: {{ password }}\r\n\r\n\r\nAfter signing in you should change your password by clicking your name on the top right corner of the administration area.\r\n\r\nYou can use the following link to sign in:\r\n{{ link }}', 2, 1, '2017-06-04 00:46:26', '2017-06-04 00:51:19'),
(2, 'backend::mail.restore', NULL, 'Password reset instructions for backend-end administrators.', NULL, NULL, 2, 0, '2017-06-04 00:46:26', '2017-06-04 00:46:26'),
(3, 'indikator.news::mail.email_en', 'Newsletter', 'E-mail', '<p>Dear {{ name }},</p>\r\n<p>New post of website:</p>\r\n<br>\r\n<p><em>{{ title }}</em><br>\r\n{{ introductory|raw }}</p>\r\n<p>www.Hotelladakhimperial.com/news/{{ slug }}</p>\r\n<br>\r\n<p>Best regards,<br>\r\nThe Team</p>', '', 1, 1, '2017-06-04 00:46:26', '2017-06-07 06:06:43'),
