(18, 'galdan.email::mail.mail_en', 'Mail', 'Mail', '<div id="address">\r\n    <h4>Hotel Ladakh Imperial</h4>\r\n    Fort Road, Nr. SBI, Leh Ladakh<br>\r\n    PIN 194101 Jammu & Kashmir, India<br>\r\n    Phone : +91 1982 250000 / 1982 250000<br>\r\n    Mobile: +91 9400000000 / 9622000000 <br>\r\n    Email : support@hotelladakhimperial.com\r\n</div>\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<p>{{ messagez }}</p>\r\n<br>\r\n\r\n\r\n<br>\r\n<br>\r\n<br>', '', 5, 1, '2017-06-16 07:36:37', '2017-06-19 02:47:47'),
(19, 'galdan.email::mail.itinerary_en', 'Itinerary', 'Itinerary', '<div id="address">\r\n    <h4>Hotel Ladakh Imperial</h4>\r\n    Fort Road, Nr. SBI, Leh Ladakh<br>\r\n    PIN 194101 Jammu & Kashmir, India<br>\r\n    Phone : +91 1982 250000 / 1982 250000<br>\r\n    Mobile: +91 9400000000 / 9622000000 <br>\r\n    Email : support@hotelladakhimperial.com\r\n</div>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<h5>Dear {{ name }},</h5>\r\n<p>Following your request, we are hereby sending you the detailed itinerary for the tour you have joined in with us.</p>\r\n<br>\r\n<p><h3>Itinerary Title: {{ title }}</h3>\r\n\r\n\r\n{% set count = 1 %}\r\n{% for day in days %}\r\n    {% if count < 10 %}\r\n        <h4>Day 0{{ count }} : {{ day.intro }}</h4>\r\n    {% else %}\r\n        <h4>Day {{ count }} : {{ day.intro }}</h4>\r\n    {% endif %}\r\n    \r\n    <p>{{ day.description }}</p>\r\n{% set count = count + 1 %}\r\n{% endfor %}\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<p>Best regards,<br>\r\nThe Team</p>', '', 3, 1, '2017-06-16 07:38:44', '2017-06-26 00:13:09'),
(20, 'galdan.sitetools::mail.contact', 'Contact Mail', 'Contact Us Email to us', '<p>{{ name }} has sent an enquiry through online contact page with the following details:</p>\r\n<br>\r\n\r\n<table>\r\n    <tbody>\r\n        <tr>\r\n            <td>Name</td><td>{{ name }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Email</td><td>{{ email }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Message</td><td>{{ messagez }}</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<p>Best regards,<br>\r\n<div id="address">\r\n    <h4>Hotel Ladakh Imperial - {{company}}</h4>\r\n    GH Road, Nr. Public School, Skara Leh Ladakh<br>\r\n    PIN 194101 Jammu & Kashmir, India<br>\r\n    Phone : +91 1982 252156<br>\r\n    Mobile: +91-9469223333 / +91-7051445588 / +91-9906999996 <br>\r\n    Email : ladakhimperial15@gmail.com\r\n</div>', '', 1, 1, '2017-06-25 21:49:34', '2018-02-03 14:43:08'),
(21, 'galdan.sitetools::mail.booking', 'Booking Mail', 'Bookings E-mail to Sender', '<p>{{ name }} has sent an online booking with the following details:</p>\r\n<br>\r\n\r\n<table>\r\n    <tbody>\r\n        <tr>\r\n            <td>Name : </td><td>{{ name }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Email : </td><td>{{ email }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contact No. : </td><td>{{ phone }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Arrival</td><td>{{ checkin }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>No. of  Pax</td><td>{{ num_persons }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Tour : </td><td>{{ tour }}</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Requirements : </td><td>{{ messagez }}</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<p>Best regards,<br>\r\n<div id="address">\r\n    <h4>Hotel Ladakh Imperial - {{company}}</h4>\r\n    GH Road, Nr. Public School, Skara Leh Ladakh<br>\r\n    PIN 194101 Jammu & Kashmir, India<br>\r\n    Phone : +91 1982 252156<br>\r\n    Mobile: +91-9469223333 / +91-7051445588 / +91-9906999996 <br>\r\n    Email : ladakhimperial15@gmail.com\r\n</div>', '', 1, 1, '2017-06-25 21:49:34', '2018-02-03 14:43:16'),
(22, 'rainlab.user::mail.invite', 'An account has been created for you', 'Invite new user created with login and password', '<div id="address">\r\n    <h4>Hotel Ladakh Imperial</h4>\r\n    Fort Road, Nr. SBI, Leh Ladakh<br>\r\n    PIN 194101 Jammu & Kashmir, India<br>\r\n    Phone : +91 1982 250000 / 1982 250000<br>\r\n    Mobile: +91 9400000000 / 9622000000 <br>\r\n    Email : support@hotelladakhimperial.com\r\n</div>\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<p>Dear {{ name }},</p>\r\n\r\n<p>\r\n    A user account has been created for you. Use this account to manage your bookings made with us.\r\n    Please use the following login and password to sign in:\r\n</p>\r\n\r\n<p>\r\n    Login: {{ login }}<br />\r\n    Password: {{ password }}\r\n</p>\r\n\r\n<p>After signing in you should change your password as soon as possible.</p>\r\n<br>\r\n<br>\r\n<br>\r\n<p>Best regards,<br>\r\nThe Team</p>\r\n<br>\r\n<br>\r\n<br>', 'Hello {{- name -}},\r\n\r\nA user account has been created for you. Please use the following login and password to sign in:\r\n\r\nLogin: {{ login }}\r\n\r\nPassword: {{ password }}\r\n\r\n*** After signing in you should change your password as soon as possible.', 5, 1, '2017-06-26 03:16:41', '2017-06-26 06:56:14'),
